  KEY `idx_date` (`date`),
  KEY `idx_token` (`token`),
  CONSTRAINT `qr_sessions_ibfk_1` FOREIGN KEY (`program_id`) REFERENCES `programs` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Table: session_participants
